  text: "Quote:\r\n\t\r\n\t\r\n\t\t\r\n\t\t\t\r\n\t\t\t\t\r\n\t\t\t\t\tOriginally Posted by browy\r\n\t\t\t\t\t\r\n\t\t\t\t\r\n\t\t\t\tGái Thụy Sĩ cho vô được không?\n\nEm Cecile. Từng chung chỗ làm. Chưa từng đụng vô. Bạn gái của thằng bạn nên hổng dám cua.\n\n\n\nEm này Ana, gái Croatia, ghệ cũ, học cùng lớp\n\r\n\t\t\t\r\n\t\t\r\n\t\r\n\t\r\n\nhộ thím mấy tấm mình cho là đệp, ko tính tấm cuối"
